('Wie heißt das "Herz" des Berges Erebor in Tolkiens "Hobbit"', 'Arkenstein', 'Londrondur', 'Endroil', 'Thorinader', null, 'Der Arkenstein, auch das Königsjuwel genannt, war der schönste und prächtigste Edelstein in Mittelerde, von den Silmaril einmal abgesehen und der größte Schatz der Könige unter dem Berg.')
('Wie heißt der 1871 geborene Dichter und Schriftsteller Morgenstern mit Vornamen?', 'Christian', 'David', 'Ansgar', 'Karl-Heinz', null, 'Christian Otto Josef Wolfgang Morgenstern (* 6. Mai 1871 in München; † 31. März 1914 in Untermais, Tirol, Österreich-Ungarn) war ein deutscher Dichter, Schriftsteller und Übersetzer. Besondere Bekanntheit erreichte seine komische Lyrik, die jedoch nur einen Teil seines Werkes ausmacht.'),
('Wie heißt der Affe in den Geschichten von "Pippi Langstrumpf"', 'Herr Nielsson', 'Herr Larsson', 'Großer Onkel', 'Kleiner Onkel', null, 'Pippi Langstrumpf ist die zentrale Figur einer dreibändigen schwedischen Kinderbuch-Reihe von Astrid Lindgren. Pippi Langstrumpf lebt zusammen mit ihrer Meerkatze (im Film: Totenkopfäffchen) Herr Nilsson und ihrem Apfelschimmel (im Film heißt das Pferd „Kleiner Onkel“, in der Villa Kunterbunt (schwedisch: Villa Villekulla) am Rande einer kleinen, namenlosen Stadt.'),
('Wie heißt der Vergnügungspark in Plailly nördlich von Paris, der Asterix und seinen Galliern gewidmet ist?', 'Parc Astérix', 'Gauleparc', 'Parcerix', 'Disneyland Resort', null, 'Der Parc Astérix ist ein im Jahr 1989 in der 30 km nördlich von Paris gelegenen Gemeinde Plailly eröffneter Freizeitpark, dem eine Hotelanlage angeschlossen ist. Dieser der Welt des Comichelden Asterix geweihte Themenpark nimmt mit etwa 1,8 Millionen Besuchern den vierten Rang unter den besucherstärksten Freizeitparks in Frankreich ein.'),
('Wer gehört NICHT zu den "Watchmen"', 'Kick-Ass', 'Dr. Manhatten', 'Nhite Owl', 'Rorschach', null, 'Watchmen ist eine 1986/87 erschienene Graphic Novel von Alan Moore (Text) und Dave Gibbons (Zeichnungen). Kick-Ass ist ein britisch-US-amerikanischer Spielfilm aus dem Jahr 2010 von Matthew Vaughn, der auf Mark Millars gleichnamigem Comic basiert. Insofern gehört Kick-Ass nicht zu den Watchmen'),
('Wie heißt der Schöpfer von "Goofy"', 'Art Babbit', 'Don Rosa', 'Carl Barks', 'Walt Disney', null, 'Goofy (adj. engl. für „albern“, „doof“) wurde von Art Babbitt (Arthur Harold Babitsky, 1907–1992) erdacht und ist der treue Freund von Micky Maus. Die Comic-Figur gehört, wie auch Donald Duck, mit zu den ersten Disneyfiguren. Ursprünglich hieß er Dippy Dawg (verdrehter Hund), 1939 wurde die Figur dann aber in Goofy umbenannt.'),
('Welche Pflanze verbirgt sich hinter dem Namen Nymphaea?', 'Seerose', 'Vogelmiere', 'Birke', 'Efeu', null, 'Die Seerosen (Nymphaea) sind eine Pflanzengattung in der Familie der Seerosengewächse (Nymphaeaceae). Die weltweit verbreitete Gattung umfasst etwa fünfzig Arten.'),
('Was ist ein "Gestreifter Marlin"?', 'Ein Fisch', 'Eine Koralle', 'Ein Krake', 'Ein Seeigel', null, 'Der indopazifische Gestreifte Marlin (Kajikia audax) gehört zur Ordnung der Schwertfischartigen. Er bildet – darin vergleichbar mit dem Fächerfisch und mit seiner atlantischen Schwesterart Weißer Marlin – ein weltweit in wärmeren Meeren verbreitetes Taxon von schnellen, epipelagischen Spitzenprädatoren, die zugleich für die Sportfischerei von größter Bedeutung sind.'),
('Welches der folgenden Produkte wird von der Firma Asus entwickelt', 'Laptop', 'Schreibtischlampe', 'Bürostuhl', 'Klimaanlage', null, 'ASUSTeK Computer Inc. (Asus) ist ein großer taiwanischer Hersteller von Computer-Hardware mit Sitz in Taipeh. Das Unternehmen ist allgemein unter dem Markennamen Asus bekannt. Asus produziert hauptsächlich Notebooks und PCs im Businessbereich und Leistungscomputerbereich (zum Beispiel Firmennetzwerke).'),
('Was produzierte John Curtis Jackson 1848 erfolgreich aus Fichtenharz', 'Kaugummi', 'Klebstoff', 'Fahrradschlauch', 'Schuhsohle', null, 'Der oder das Kaugummi ist eine leicht verformbare, meist süß, manchmal auch scharf (Minze) oder sauer schmeckende Masse in einer Portionsverpackung, auf der oft einige Stunden lang gekaut werden kann, ohne dass sie zerfällt. Der erste Kaugummifabrikant war der US-Amerikaner John Curtis Jackson. Er verwendete ein indianisches Rezept mit Fichtenharz als Grundstoff und Bienenwachs. 1848 begann er mit der Produktion seines Kaugummis und war auf Anhieb erfolgreich.'),
('Aus welchem Land kommt die Spielzeugmarke Lego', 'Dänemark', 'Niederlande', 'Belgien', 'Deutschland', null, 'Die Lego A/S (auch The LEGO Group, Eigenschreibweise: LEGO) ist ein dänisches Unternehmen und größter Spielzeughersteller der Welt, das durch die mittlerweile als Spielzeugklassiker geltenden Legosteine bekannt wurde. Das Wort Lego leitet sich von dänisch leg godt „spiel gut“ ab.'),
('Welche britische Zeitung hatte 1989 die umstrittene und viel diskutierte Schlagzeile "THE TRUTH" auf der Titelseite?', 'The Sun', 'The Evening Standard', 'The Daily Mirror', 'The Times', null, 'Unter dem Titel „The Truth“ (Die Wahrheit) wurde in der Boulevardzeitung The Sun vier Tage nach der Hillsborough-Katastrophe wahrheitswidrig behauptet, Liverpool-Fans hätten Rettungsversuche der Polizei behindert und Betroffene beraubt. Die Hillsborough-Katastrophe war ein schweres Zuschauerunglück mit 96 Toten und 766 Verletzten am 15. April 1989 im Hillsborough Stadium in Sheffield. Sie ereignete sich während des Halbfinalspiels um den FA Cup zwischen dem FC Liverpool und Nottingham Forest.'),
('Wie viele Goldmedaillen gewann Georg Hackl bei der Wok-WM', '9', '11', '5', '2', null, 'Hackl nahm bisher an 12 Weltmeisterschaften der Funsportart Wok-Fahren teil. Im Einzel-Wok wurde er neunmal Weltmeister (2004, 2005, 2007–2013) und dreimal Vizeweltmeister (2006, 2014 und 2015), im Vierer-Wok erreichte er einmal den zweiten Platz (2006). Damit ist Hackl der mit Abstand erfolgreichste Wok-Fahrer.'),
('In welchem Zeitraum waren Bruce Willis und Demi Moore verheiratet?', '1987-2000', '2000-2005', '1985-1996', '1999-2005', null, 'Am 21. November 1987 heiratete sie den Schauspieler Bruce Willis. Das Paar hat drei gemeinsame Töchter. Am 24. Juni 1998 trennten sich Moore und Willis, sie reichten die Scheidung allerdings erst am 18. Oktober 2000 ein, bereits tags darauf war sie rechtskräftig.'),
('Wie heißt das außerirdische Wesen, das in der Serie "Superman" die Herrschaft über die Erde übernehmen will?', 'Brainiac', 'The Joker', 'Morgan Edge', 'Lex Luthor', null, 'Brainiac ist eine Comicfigur, die 1958 von dem US-amerikanischen Science-Fiction-Schriftsteller Otto Binder geschaffen wurde.  In den frühen Superman-Geschichten wurde Brainiac als ein grünhäutiger außerirdischer Wissenschaftler und Eroberer definiert.'),
('Wie heißt die Grunge-Band von Trent Lane aus der Zeichentrickserie "Daria"?', 'Mystic Spiral', 'Malfunkshun', 'L7', 'The Melvins', null, 'Mystic Spiral ist die Band, welche von Trent Lane geleitet wird. Dieser ist der Bruder von Darias Freund Jane. Die Band ist eine alternative rock-grunge Band, wobei Elemente des Heavy Metal enthalten sind.'),
('Welche Serie handelt von einem Jungen und seinem Spielzeugtieger?', 'Calvin und Hobbes', 'Draußen auf der Weide', 'Marsupilami', 'Beetle Bailey', null, 'Calvin und Hobbes ist ein Comicstrip von Bill Watterson. Die beiden Hauptfiguren des Strips sind Calvin, ein sechsjähriger Junge, der mit seinen Eltern in einem Vorort einer nie benannten amerikanischen Stadt lebt, und sein (Stoff-)Tiger Hobbes.'),
('Wie heißt die im Jahre 2006 von Nintendo veröffentlichte Spiele-Konsole, die mit ihren optischen Kontrollen die Videospiele revolutioniert hat?', 'Wii', 'Gamecube', 'Playstation 3', 'XBOX 360', null, 'Die Wii ist eine 2006 von Nintendo veröffentlichte Spielkonsole. Ihr wesentliches Merkmal ist ein Controller, der herkömmlichen Fernbedienungen ähnelt, aber über eingebaute Bewegungssensoren verfügt. Diese registrieren die Lage und die Bewegungen des Controllers im Raum und setzen sie in entsprechende Bewegungen von Spielfiguren oder -elementen auf dem Bildschirm um.'),
('Was ist KEINE wählbare Rasse in "World of Warcraft"', 'Kreuzritter', 'Orks', 'Menschen', 'Trolle', null, 'Die Völker von World of Warcraft leben in Azeroth und teilen sich in die Allianz (Pandaren, Worgen, Draenai, Zwerge, Gnome, Menschen, Nachtelfen) und in die Horde auf (Pandaren, Goblins, Blutelfen, Orcs, Tauren, Trolle, Untote)'),
('Wer hat das Spiel "Tibia" entwickelt?', 'Cipsoft', 'Mojang', 'Jagex', 'Dice', null, 'Tibia ist eines der ältesten und erfolgreichsten Massen-Mehrspieler-Online-Rollenspiele (Massive Multiplayer Online Role Playing Game, kurz MMORPG) Europas. Tibia wird vom Regensburger Softwareentwickler CipSoft entwickelt und vermarktet. Weltweit spielen mehr als 500.000 aktive Menschen Tibia.'),
('Welcher Stoff ist in Colagetränken üblicherweise enthalten?', 'Kohlendioxid', 'Kohlenmonoxid', 'Colatrioxid', 'Taurin', null, 'Kohlensäure (H2CO3) ist eine anorganische Säure und das Reaktionsprodukt ihres Säureanhydrids Kohlendioxid (CO2) mit Wasser. Da Cola Kohlensäure enthält, enthält sie auch Kohlendioxid'),
('In welcher Einheit wird die Farbe von Bier unterschieden', 'EBC', 'BMI', 'IBM', 'GBM', null, 'Mit der Einheit EBC wird im Europäischen Raum die Farbe (genauer: Die Farbstärke) von Bier und Bierwürze beschrieben. Der von der European Brewery Convention festgelegte Wert bezeichnet, wie viel Licht von Bier eines bestimmten Stammwürzegehalts absorbiert wird'),
('Wie nennt man das Antiteilchen eines Elektrons mit dem Formelzeichen "e+"?', 'Positron', 'Negatron', 'Neutron', 'Proton', null, 'Das Positron (Kunstwort aus positive Ladung und Elektron), Formelzeichen e+, ist ein Elementarteilchen aus der Gruppe der Leptonen. Es ist das Antiteilchen des Elektrons, mit dem es bis auf das Vorzeichen der elektrischen Ladung und des magnetischen Moments in allen Eigenschaften übereinstimmt.'),
('Welches Elementsymbol hat Thallium im Periodensystem?', 'Tl', 'Tu', 'Tm', 'Ta', null, 'Thallium ist ein chemisches Element mit dem Elementsymbol Tl und der Ordnungszahl 81. Im Periodensystem steht es in der 3. Hauptgruppe, bzw. der 13. IUPAC-Gruppe, der Borgruppe. Das weiche, graue und dem Blei sehr ähnliche Metall ist äußerst giftig.'),
('Welcher Begriff beschreibt den Zustand, aus dem sich das Universum ausbreitete?', 'Singularität', 'Supernova', 'Megaplanet', 'Roter Zwerg', null, ' Extrapoliert man die Expansion im Rahmen der Allgemeinen Relativitätstheorie immer weiter in die Vergangenheit, gelangt man allerdings an einen unerfreulichen Punkt in den Gleichungen: die Singularität. Hier bricht die Physik zusammen, die Naturgesetze verlieren ihre Gültigkeit und wissenschaftliche Aussagen sind unmöglich, weil Temperatur und Dichte unendlich, Raum und Zeit dagegen null werden.'),
('Welche Wortbedeutung hat der Name Felix?', 'Der Glückliche', 'Der Erhabene', 'Der Geduldsame', 'Der Sparsame', null, 'Felix kommt aus dem Lateinischen (felix, felicis) und bedeutet „vom Glück begünstigt“, „glücklich“, „erfolgreich“, oder „der Glückliche“. Weibliche Versionen des Vornamens sind Felicitas, Felicia und Felizitas. Die italienische Form des Namens ist Felice.'),
